Oto przykadowa klasa BankAccount napisana w jzyku Java . Klasa ta zawiera dokumentacj kodu oraz jest poprawnie opisana . /** * Klasa reprezentujca rachunek bankowy. * * @author Jan Kowalski * @version 1.0 */
public class BankAccount { // Numer konta bankowego. private String accountNumber; // Saldo konta bankowego. private double balance; /** * Konstruktor klasy BankAccount. * @param accountNumber Numer konta bankowego. * @param balance Saldo konta bankowego. */ public BankAccount(String accountNumber, double balance) { this.accountNumber = accountNumber; this.balance = balance; } /** * Zwraca numer konta bankowego. * @return Numer konta bankowego. */ public String getAccountNumber() { return accountNumber; } /** * Zwraca saldo konta bankowego. * @return Saldo konta bankowego. */ public double getBalance() { return balance; } /** * Dokonuje wpaty na konto bankowe. * @param amount Kwota wpaty. */ public void deposit(double amount) { balance += amount; } /** * Dokonuje wypaty z konta bankowego. * @param amount Kwota wypaty. */ public void withdraw(double amount) { balance -= amount; }
} Dokumentacja kodu w Javie jest tworzona za pomoc komentarzy . Komentarze w Javie mog by tworzone na dwa sposoby: // To jest komentarz. /* To jest komentarz. */ W tym przykadzie dokumentacja zawiera nastpujce informacje : nazwa klasy - BankAccount autor - Jan Kowalski wersja - 1.0 opis og贸lny - klasa reprezentujca rachunek bankowy. opis p贸l: accountNumber - numer konta bankowego. balance - saldo konta bankowego. opis metod: getAccountNumber() - zwraca numer konta bankowego. getBalance() - zwraca saldo konta bankowego. deposit() - dokonuje wpaty na konto bankowe. withdraw() - dokonuje wypaty z konta bankowego.
